// SPDX-License-Identifier: MIT
pragma solidity >0.4.23 <0.9.0;

import "./Escrow.sol";

contract EscrowFactory {
    address payable public buyer;
    Escrow[] private _escrowsArray;

    function createEscrow() public {
        Escrow escrow = new Escrow();
        _escrowsArray.push(escrow);
    }

    function initializer(
        uint256 _index,
        address payable _commissionWallet,
        uint256 _minimumEscrowAmount,
        uint256 _commission
    ) public {
        Escrow(address(_escrowsArray[_index])).initialiser(
            _commissionWallet,
            _minimumEscrowAmount,
            _commission
        );
    }

    function escrowParties(
        uint256 _index,
        address payable _buyer,
        address payable _seller
    ) public {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(
                abi.encodeWithSignature("escrowParties", _buyer, _seller)
            );
    }

    function buyerdeposits(uint256 _index) public payable {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(abi.encodeWithSignature("deposit"));
    }

    function sellerAccepts(uint256 _index) public payable {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(abi.encodeWithSignature("acceptDeal"));
    }

    function someoneReleases(uint256 _index) public payable {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(abi.encodeWithSignature("releaseFund"));
    }

    function getCurrState(uint256 _index) public payable {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(abi.encodeWithSignature("getCurrentState"));
    }

    function commissionChange(uint256 _index, uint256 comm_rate)
        public
        payable
    {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(
                abi.encodeWithSignature("changeCommissionRate", comm_rate)
            );
    }

    function getCommRate(uint256 _index) public payable {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(abi.encodeWithSignature("getCommission"));
    }

    function after6Months(uint256 _index, address payable ownerAccount)
        public
        payable
    {
        (bool success, bytes memory data) = address(_escrowsArray[_index])
            .delegatecall(
                abi.encodeWithSignature("itsbeen6Months", ownerAccount)
            );
    }
}
